	<text transform="matrix(1 0 0 1 201.4427 335.9)"><tspan x="0" y="0" class="st69 st70">Dating apps have radically changed the dating game. Personalities are condensed into a single profile, </tspan><tspan x="0" y="43.2" class="st69 st70">often viewed for only a few seconds. We are confronted with a summary of a person&apos;s life, including in</tspan><tspan x="1551.29" y="43.2" class="st69 st70">-</tspan><tspan x="0" y="86.4" class="st69 st70">formation we would never know when meeting someone in person for the first time. I want to understand </tspan><tspan x="0" y="129.6" class="st69 st70">how people identify their ideal partners in the modern dating scene. </tspan><tspan x="0" y="216" class="st69 st70">I surveyed New School students on their ideal type. The questions are modeled after those used in </tspan><tspan x="0" y="259.2" class="st69 st70">dating profiles, such as height, zodiac, dating goals, etc. Using the data, I compiled the most popular </tspan><tspan x="0" y="302.4" class="st69 st70">traits into a single dating profile, creating the statistical &quot;most desirable&quot; person. </tspan></text>

<div class="tooltip"></div>

<script type="text/javascript">

let tooltip=document.querySelector('.tooltip')

// gets position of mouse on the page
function getpos(event) {
	var e = window.event;
	x = e.clientX ;
	y = e.clientY ;
} 

function updateTooltip(text_to_display){
	tooltip.innerHTML=text_to_display
	getpos()
	tooltip.style.display='block'
	tooltip.style.opacity=1
	tooltip.style.left=x+30+"px"
	tooltip.style.top=y-30+"px"
}

function updateImgTooltip(img_to_display){
	tooltip.style.display='block'
	tooltip.innerHTML=''
	tooltip.style.opacity=1
	picture = document.createElement('img')
	picture.src=img_to_display
	tooltip.appendChild(picture)
	getpos()
	tooltip.style.left=x+30+"px"
	tooltip.style.top=y-30+"px"
}

function clearTooltip() {
	tooltip.style.display='none'
	tooltip.style.opacity=0
}

</script>
